import classes from "./Email.module.css";

function ProgressBar() {
  return (
    <div>
      <progress value="52" max="100">
        {" "}
        52%{" "}
      </progress>
      <ul className={classes.progressbar}>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </div>
  );
}

export default ProgressBar;
